// SPDX-License-Identifier:UNLICENSED

pragma solidity >=0.8.2 <0.9.0;

contract ChainPay {
    event transactions(
        address indexed from,
        address to,
        uint256 ammount,
        string symbol
    );

    function _transfer(
        address payable _to,
        string calldata symbol
    ) external payable {
        _to.transfer(msg.value);
        emit transactions(msg.sender, _to, msg.value, symbol);
    }
}

